/* eslint-disable react-hooks/rules-of-hooks */
import React from "react";
import { Grid, Label, Checkbox, Form } from "semantic-ui-react";
import { countryOptions, jobOptions } from "assets/selectableOptions";
import WithSelect from "components/container/withSelect";
import WithButtonGroup from "components/container/withButtonGroup";

const UserForm: React.FC = () => {
  return (
    <React.Fragment>
      <Form>
        <Grid columns={2} divided="vertically">
          <Grid.Row centered>
            <WithSelect name="Country" options={countryOptions} />
            <WithSelect name="Job" options={jobOptions} />
          </Grid.Row>
          <Grid.Row>
            <Grid.Column textAlign="center">
              <Label size="medium">Password</Label>
              <div>
                <Checkbox toggle />
              </div>
            </Grid.Column>
            <WithButtonGroup />
          </Grid.Row>
        </Grid>
      </Form>
    </React.Fragment>
  );
};

export default UserForm;
